import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gradient-to-r from-blue-200 to-purple-200">
      <h1 className="text-4xl font-bold mb-4">Welcome to Note Keeper</h1>
      <p className="mb-6 text-lg">Organize your notes easily, with guest mode and premium features!</p>
      <div className="space-x-4">
        <Link to="/login" className="px-6 py-2 bg-blue-600 text-white rounded">Login</Link>
        <Link to="/register" className="px-6 py-2 bg-green-600 text-white rounded">Register</Link>
      </div>
    </div>
  );
};

export default Home;
